import react from 'react';

const persons=(props)=>{

    props.persons.map((pers,index)=>{
        return(
          <Person 
          name={pers.name}
          age={pers.age}
          click={()=>props.click(index)}    // Delete 
          onChangeListener={(event)=>props.onChange(event,pers.id)}
          key={pers.id}

          />
        )

    });
}

export default persons
